/* WebMIDI.wafReverberator namespace containing a WAFReverberator constructor.
 */

WebMIDI.namespace('wafReverberator');

WebMIDI.wafReverberator = (function(window)
{
	"use strict";

    let
        input,
        output,
        dry,
        wet,
        convolver,

        constructGraph = function(audioContext)
        {
            input = audioContext.createBiquadFilter();
            output = audioContext.createGain();
            dry = audioContext.createGain();
            wet = audioContext.createGain();
            convolver = audioContext.createConvolver();

            input.connect(dry);
            input.connect(wet);
            dry.connect(output);
            wet.connect(convolver);
            convolver.connect(output);

            input.type = "lowpass";
            input.frequency.setTargetAtTime(18000, 0, 0);
        },

        setConvolverBuffer = function(convolver, audioContext)
        {
            function getArrayBuffer()
            {
                // see https://github.com/surikov/webaudiofont/blob/master/npm/src/reverberator.js
                // and http://www.openairlib.net
                let irr = "";

                let arrayBuffer = new ArrayBuffer(irr.length / 2),
                    view = new Uint8Array(arrayBuffer),
                    decoded = atob(irr);

                for(let i = 0; i < decoded.length; i++)
                {
                    let b = decoded.charCodeAt(i);
                    view[i] = b;
                }

                return arrayBuffer;
            }

            let arrayBuffer = getArrayBuffer();

            audioContext.decodeAudioData(arrayBuffer, function(audioBuffer)
            {
                convolver.buffer = audioBuffer;
                //console.log('convolver audioBuffer', audioBuffer);
            });
        },

		WAFReverberator = function(audioContext)
        {
            if (!(this instanceof WAFReverberator))
            {
                return new WAFReverberator(audioContext);
            }

            constructGraph(audioContext);
            setConvolverBuffer(convolver, audioContext);

            Object.defineProperty(this, "input", { value: input, writable: false });
            Object.defineProperty(this, "output", { value: output, writable: false });
            Object.defineProperty(this, "dry", { value: dry, writable: false });
            Object.defineProperty(this, "wet", { value: wet, writable: false });
            Object.defineProperty(this, "convolver", { value: convolver, writable: false });
        },

		API =
		{
            WAFReverberator: WAFReverberator // constructor
		};
	    // end var

    WAFReverberator.prototype.setValueAtTime = function(midiValue, atTime)
    {
        let r1 = midiValue / 127, // in range [0..1]
            r2 = 1 - r1,
            rMax = (r1 > r2) ? r1 : r2,
            normFactor = 1 / rMax;

        r1 *= normFactor;
        r2 *= normFactor;
        // the greater of r1 or r2 is now 1
        let wetValue = r1,
            dryValue = r2;

        this.dry.gain.setValueAtTime(dryValue, atTime);
        this.wet.gain.setValueAtTime(wetValue, atTime);
    };

    WAFReverberator.prototype.disconnect = function()
    {
        this.input.disconnect();
        this.output.disconnect();
        this.dry.disconnect();
        this.wet.disconnect();
        this.convolver.disconnect();
    };

	return API;

}(window));
